import React, { Component } from "react";

class MovieDesc extends Component {
    state={
        title: "title",
        desc: "desc",
        imageURL: "image"
    }
    render(){
        React.createElement('div')
        return (<div><h3>{this.state.title}</h3></div>);
    }
}

export default MovieDesc;
